import React from "react";
import "./App.css";

window.addEventListener("resize", () => {
  let vh = window.innerHeight * 0.01;
  document.documentElement.style.setProperty("--vh", `${vh}px`);
});

function App() {
  return <div className="App"></div>;
}

export default App;
